import React from 'react';
import { Container } from 'react-bootstrap';
import Header from '../Header';


/**
* @author
* @function 
**/

const Layout = (props) => {
  return(
    <>
    <Header/>
    <Container>
         {props.children}
    </Container>
    
    </>
   )

 }

export default Layout
